import React, { Component } from 'react'
import FoodCard_Component from '../components/FoodCard_Component'

export default class VoteOnFood extends Component {
  render() {
    return (
      <div>
        <FoodCard_Component fname={"ข้าวผัด"} fType={"เมนูเส้น"} fImg={"https://cdn.discordapp.com/attachments/917794703955599374/1155160761845420092/ptia-hero.png"}/>
        <FoodCard_Component fname={"กะเพราหมูสับ"} fType={"เมนูข้าว"} fImg={"https://cdn.discordapp.com/attachments/917794703955599374/1155160937620324402/cd32a0364b7a.png"}/>
      </div>
    )
  }
}
